background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Door te verkopen op eBay, de grootste online marktplaats ter wereld, brengt u miljoenen nieuwe klanten binnen handbereik. U kunt:</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 107%; font-family: Arial, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">- een nieuw, winstgevend verkoopkanaal opzetten;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 107%; font-family: Arial, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">- snel en gemakkelijk over de grens in Europa en wereldwijd handel drijven;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 107%; font-family: Arial, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">- aanbiedingen maken en beide verkoopkanalen vanuit één plek aansturen;</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 107%; font-family: Arial, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">- de eBay-module zonder bijkomende kosten installeren.</span></p>\r\n<p class=\"MsoNormal\"> </p>					<div class=\"gamification-tip-infobox-content-controls right\">\n						<a href=\"javascript:$.fancybox.close();\" class=\"button\">Annuleer</a>\n						<a href=\"{link}AdminModules{/link}&install=ebay&module_name=ebay\" class=\"button success\">Bekijk de geïntegreerde module</a>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n</div>\n<script>\n	$(document).ready( function () {\n		$(\'.gamification_fancybox\').bind(\'click\', function () {\n			id_advice = 375;\n			popin_url = \'https://gamification.prestashop.com/get_advice_link.php?id_advice=\'+id_advice+\'&url=\';\n			url = window.location.origin+window.location.pathname.replace(\'index.php\', \'\')+$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\');\n			$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\', popin_url+encodeURIComponent(url));\n			\n			$(\'.gamification-tip-infobox\').after(\'<img style=\"display:none\" src=\"https://gamification.prestashop.com/api/getAdvicePopinImg/\'+id_advice+\'.png\" />\');\n			\n		});\n	});\n</script></div>'),
