ele app. Door de mobiele navigatie en betaalmethode van Shopgate, kunnen uw mobiele klanten snel vinden en aanschaffen wat ze zoeken.</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13.333333969116211px; white-space: pre-wrap;\" /><span style=\"font-family: arial, sans, sans-serif; font-size: 13.333333969116211px; white-space: pre-wrap;\">Ontdek de Shopgate-module en verover de snelgroeiende m-commerce markt met uw webwinkel op mobiel.</span></p>					<div class=\"gamification-tip-infobox-content-controls right\">\n						<a href=\"javascript:$.fancybox.close();\" class=\"button\">Annuleren</a>\n						<a href=\"{link}AdminModules{/link}&install=shopgate&module_name=shopgate\" class=\"button success\">Ontdek de module</a>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n</div>\n<script>\n	$(document).ready( function () {\n		$(\'.gamification_fancybox\').bind(\'click\', function () {\n			id_advice = 466;\n			popin_url = \'https://gamification.prestashop.com/get_advice_link.php?id_advice=\'+id_advice+\'&url=\';\n			url = window.location.origin+window.location.pathname.replace(\'index.php\', \'\')+$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\');\n			$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\', popin_url+encodeURIComponent(url));\n			\n			$(\'.gamification-tip-infobox\').after(\'<img style=\"display:none\" src=\"https://gamification.prestashop.com/api/getAdvicePopinImg/\'+id_advice+\'.png\" />\');\n			\n		});\n	});\n</script></div>'),
