('310','1','<div id=\"wrap_id_advice_537\" >\n		<section id=\"0_googleadwords\" class=\"panel \" style=\"display:none\">\n			<header class=\"panel-heading\">\n				<span class=\"icon-lightbulb\"></span> Tips of the day</header>\n			<div class=\"panel-body\" style=\"padding:0\">\n				<img class=\"img-responsive\" src=\"https://api.prestashop.com/partner/tipsoftheday/img/logo-googleadwords.png\" style=\"float:right; margin-left: 5px;\">\n				<img src=\"https://gamification.prestashop.com/api/getAdviceImg/537.png\"/>\n				<p><b>Verbeter eenvoudig uw zoekmachineranking met een klein budget.</b></p>\n				<p>Wanneer u het voor het advertentiemodel \'kosten per klik\' (CPC) kiest, bepaalt u vooraf uw budget en betaalt u alleen wanneer iemand uw website bezoekt! Start een campagne en u krijgt <b>75€ gratis bij besteding van 25€!</b></p>\n				<span class=\"text-right\" style=\"float:right\">\n					<a class=\"btn btn-default\" target=\"_blank\" href=\"https://gamification.prestashop.com/get_advice_link.php?id_advice=537&url=http%3A%2F%2Fwww.google.com%2Fintl%2Fnl%2Fads%2Fget%2Fprestashop75%2Findex.html%3Futm_source%3Dback-office%26utm_medium%3Dtipoftheday%26utm_campaign%3Dpartenariats%26utm_content%3Dgoogleadwords\">Nu een campagne beginnen!</a>\n				</span>\n			</div>\n		</section>\n		<section id=\"1_googleadwords\" class=\"panel \" style=\"display:none\">\n			<header class=\"panel-heading\">\n				<span class=\"icon-lightbulb\"></span> Tips of the day</header>\n			<div class=\"panel-body\" style=\"padding:0\">\n				<img class=\"img-responsive\" src=\"https://api.prestashop.com/partner/tipsoftheday/img/logo-googleadwords.png\" style=\"float:right; margin-left: 5px;\">\n				<img src=\"https://gamification.prestashop.com/api/getAdviceImg/537.png\"/>\n				<p><b>Wat typt men in het zoekvak van Google om u te vinden?</b></p>\n				<p>Beantwoord deze vraag door zeer specifieke zoekwoorden te kiezen voor uw advertenties en hooggekwalificeerde bezoekers te trekken! Profiteer van een gr