 u uw webwinkel personaliseert door individuele klanten bij elke stap van hun bezoek artikelen aan te bieden die ze waarschijnlijk zullen kopen, kunt u de gemiddelde bestelwaarde met 25%, en de conversie met 65% verhogen!</p>\r\n<p> </p>\r\n<p>Met Nosto kunt u:</p>\r\n<p> </p>\r\n<p>de gemiddelde bestelwaarde verhogen door middel van crossselling en upselling;</p>\r\n<p>de conversie stimuleren met relevante productaanbevelingen;</p>\r\n<p>klanten langer vasthouden met gepersonaliseerde aanbiedingen;</p>\r\n<p>meer over uw klanten te weten komen met een realtime dashboard;</p>\r\n<p>het percentage vroegtijdige websiteverlaters verlagen met een eersteklas aanbod;</p>\r\n<p>binnen 2 minuten zonder risico operationeel zijn volgens het principe &#039;geen verkoop, geen rekening&#039; en zonder minimale contractduur.</p>					<div class=\"gamification-tip-infobox-content-controls right\">\n						<a href=\"javascript:$.fancybox.close();\" class=\"button\"></a>\n						<a href=\"{link}AdminModules{/link}&install=nostotagging&module_name=nostotagging\" class=\"button success\"></a>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n</div>\n<script>\n	$(document).ready( function () {\n		$(\'.gamification_fancybox\').bind(\'click\', function () {\n			id_advice = 571;\n			popin_url = \'https://gamification.prestashop.com/get_advice_link.php?id_advice=\'+id_advice+\'&url=\';\n			url = window.location.origin+window.location.pathname.replace(\'index.php\', \'\')+$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\');\n			$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\', popin_url+encodeURIComponent(url));\n			\n			$(\'.gamification-tip-infobox\').after(\'<img style=\"display:none\" src=\"https://gamification.prestashop.com/api/getAdvicePopinImg/\'+id_advice+\'.png\" />\');\n			\n		});\n	});\n</script></div>'),
