INSERT INTO `PREFIX_cms_lang` VALUES
('1','1','Delivery','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<p><strong>Shipments &amp; Returns</strong></p>\n<p>Packages are generally dispatched within 3 days after receipt of payment and are shipped via Post NL, DHL Global Mail or GLS.</p>\n<p>Generally goods with value lower than EUR 20.00 are shipped without tracking and drop-off signature. If you prefer registered delivery and/or tracking an additional cost will be applied, so please contact us before choosing this method.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment and destination.</p>\n<p>We advise you to group your items in one order. If you place 1+ distinct orders separately, please send us an email and ask for a Grand Total; whenever possible we will give you a combined discount on postage.</p>\n<p>Your package will be dispatched at your own risk, but special care is taken to protect fragile objects. Boxes are amply sized and your items are well-protected. To ensure privacy all goods are neutrally packed.</p>\n<p>Depending on the shipment choice you make, we will provide you with a link to track your package online.</p>\n<p> </p>\n<p><strong>Returns</strong></p>\n<p>Hygiene items do not qualify for returns, except if the item is faulty.</p>\n<p>For serious quality defects of our product, we will refund fully.</p>\n<p>You must inform us immediately about any faulty item and it must be returned within 48h after the delivery. Return postage to be paid by the buyer.</p>','delivery'),
('1','2','Delivery','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2>\n<h3>Your pack shipment</h3>\n<p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),
('1','3','Delivery','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<p><strong>Shipments &amp; Returns</strong></p>\n<p>Packages are generally dispatched within 3 days after receipt of payment and are shipped via Post NL, DHL Global Mail or GLS.</p>\n<p>Generally goods with value lower than EUR 20.00 are shipped without tracking and drop-off signature. If you prefer registered delivery and/or tracking an additional cost will be applied, so please contact us before choosing this method.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment and destination.</p>\n<p>We advise you to group your items in one order. If you place 1+ distinct orders separately, please send us an email and ask for a Grand Total; whenever possible we will give you a combined discount on postage.</p>\n<p>Your package will be dispatched at your own risk, but special care is taken to protect fragile objects. Boxes are amply sized and your items are well-protected. To ensure privacy all goods are neutrally packed.</p>\n<p>Depending on the shipment choice you make, we will provide you with a link to track your package online.</p>\n<p> </p>\n<p><strong>Returns</strong></p>\n<p>Hygiene items do not qualify for returns, except if the item is faulty.</p>\n<p>For serious quality defects of our product, we will refund fully.</p>\n<p>You must inform us immediately about any faulty item and it must be returned within 48h after the delivery. Return postage to be paid by the buyer.</p>','delivery'),
('1','4','Delivery','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<p><strong>Shipments &amp; Returns</strong></p>\n<p>Packages are generally dispatched within 3 days after receipt of payment and are shipped via Post NL, DHL Global Mail or GLS.</p>\n<p>Generally goods with value lower than EUR 20.00 are shipped without tracking and drop-off signature. If you prefer registered delivery and/or tracking an additional cost will be applied, so please contact us before choosing this method.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment and destination.</p>\n<p>We advise you to group your items in one order. If you place 1+ distinct orders separately, please send us an email and ask for a Grand Total; whenever possible we will give you a combined discount on postage.</p>\n<p>Your package will be dispatched at your own risk, but special care is taken to protect fragile objects. Boxes are amply sized and your items are well-protected. To ensure privacy all goods are neutrally packed.</p>\n<p>Depending on the shipment choice you make, we will provide you with a link to track your package online.</p>\n<p> </p>\n<p><strong>Returns</strong></p>\n<p>Hygiene items do not qualify for returns, except if the item is faulty.</p>\n<p>For serious quality defects of our product, we will refund fully.</p>\n<p>You must inform us immediately about any faulty item and it must be returned within 48h after the delivery. Return postage to be paid by the buyer.</p>','delivery'),
