('3','1','Terms and conditions','Our terms and conditions','conditions, terms, use, sell','<p dir=\"ltr\"><strong>Terms &amp; Conditions</strong></p>\n<p dir=\"ltr\">of Rubberfun.nl webshop</p>\n<p dir=\"ltr\"> </p>\n<p dir=\"ltr\">These terms &amp; conditions were last updated on May-31-2015.</p>\n<p dir=\"ltr\"> </p>\n<p dir=\"ltr\">By buying from Rubberfun.nl you agree to our terms &amp; conditions.</p>\n<p dir=\"ltr\"> </p>\n<p dir=\"ltr\"><strong>About us</strong></p>\n<ul><li dir=\"ltr\">\n<p dir=\"ltr\">Rubberfun.nl (“Rubberfun”) is a webshop operated by LRG Utrecht. We are registered in Utrecht, The Netherlands (European Union), under company number 30274259.</p>\n</li>\n</ul><p dir=\"ltr\">Our main trading address is: Händelstraat 82, 3533 GM Utrecht.</p>\n<p dir=\"ltr\">Our VAT number is NL091943504B01.</p>\n<p dir=\"ltr\">In case of legal action the Dutch law applies.</p>\n<ul><li dir=\"ltr\">\n<p dir=\"ltr\">We strive to provide you the best quality price performance and best service. See “About us” in the information section of our website to find out more.</p>\n</li>\n</ul><p dir=\"ltr\"> </p>\n<p dir=\"ltr\"><strong>Privacy</strong></p>\n<ul><li dir=\"ltr\">\n<p dir=\"ltr\">All listings are private and we will only leave feedback if you do for us - unless you ask us not to.</p>\n</li>\n<li dir=\"ltr\">\n<p dir=\"ltr\">All provided data is used only for your convenience and will not be exchanged with other persons or organizations.</p>\n</li>\n</ul><p dir=\"ltr\"> </p>\n<p dir=\"ltr\"><strong>Prices</strong></p>\n<ul><li dir=\"ltr\">\n<p dir=\"ltr\">All prices include VAT and exclude any import duty.</p>\n</li>\n</ul><p dir=\"ltr\"> </p>\n<p dir=\"ltr\"><strong>Payments</strong></p>\n<ul><li dir=\"ltr\">\n<p dir=\"ltr\">We accept any major credit card through PayPal and Skrill. Within EU a bank payment or transfer is preferred. And in The Netherlands you can also pay with iDeal. No cheques.</p>\n</li>\n<li dir=\"ltr\">\n<p dir=\"ltr\">All payments must be made within 7 days after your purchase.</p>\n</li>\n</ul><p dir=\"ltr\"> </p>\n<p dir=\"ltr\"><strong>Dispatch &amp; Delivery</strong></p>\n<ul><li dir=\"ltr\">\n<p dir=\"ltr\">All purchases – except MtM products - are usually posted within 72 hours after receiving fully cleared payment, Monday to Friday only (excluding Bank Holidays).</p>\n</li>\n</ul><ul><li dir=\"ltr\">\n<p dir=\"ltr\">Delivery time is depending on the destination and the postal service used. We cannot give a guaranteed time frame and delays can occur, especially at peak periods or by goods being held by customs, which are both completely out of our control.</p>\n</li>\n<li dir=\"ltr\">\n<p dir=\"ltr\">Import charges or fees are the buyer\'s responsibility. In order to ensure you receive your order tax free or lower tax upon import, we\'ll declare it as a \"gift\" with a low value.</p>\n</li>\n<li dir=\"ltr\">\n<p dir=\"ltr\">All purchases will be sent to the address supplied by the customer. It is the customer who is responsible for a correct delivery address and accepting the goods when delivered by the courier.</p>\n</li>\n<li dir=\"ltr\">\n<p dir=\"ltr\">We normally send all items with priority airmail. Standard airmail shipment will be on buyer’s risk, registered or insured shipment is on seller’s risk. Tracking is only available with registered or insured shipment.</p>\n</li>\n</ul><ul><li dir=\"ltr\">\n<p dir=\"ltr\">We offer a combined discount on postage and packaging for items that are purchased within 48 hours of the first purchase. To qualify, all purchases must be on the one and only invoice, paid for at the same time and the delivery address must be the same for each item. </p>\n</li>\n</ul><p dir=\"ltr\"> </p>\n<p dir=\"ltr\">If you want to take advantage of postage discount, do not make a payment or complete the checkout. Instead ask us for the total to pay or simply wait for us to send a combined invoice. Unfortunately if you do not wait for us to send a combined invoice before making payment or completing the checkout process, we are unable to offer you a combined discount on postage and packaging.</p>\n<ul><li dir=\"ltr\">\n<p dir=\"ltr\">We always send an email to confirm your item has been posted, which is sent to the email address you have registered with us.</p>\n</li>\n</ul><p dir=\"ltr\"> </p>\n<p dir=\"ltr\"><strong>Returns and refunds</strong></p>\n<ul><li dir=\"ltr\">\n<p dir=\"ltr\">Hygiene items do not qualify for returns, except if the item is faulty.</p>\n</li>\n<li dir=\"ltr\">\n<p dir=\"ltr\">For serious quality defects of our product, we will refund fully.</p>\n</li>\n<li dir=\"ltr\">\n<p dir=\"ltr\">You must inform us immediately about any faulty item and it must be returned within 72 hours after the delivery. Return postage to be paid by the buyer.</p>\n</li>\n</ul><p dir=\"ltr\"> </p>\n<p dir=\"ltr\"><strong>Product liability</strong></p>\n<ul><li dir=\"ltr\">\n<p dir=\"ltr\">We do not take responsibility for any faults, damages or injuries caused by inappropriate or incorrect use or poor care of products sold by Rubberfun.</p>\n</li>\n</ul><ul><li dir=\"ltr\">\n<p dir=\"ltr\">Our rubber products may contain natural latex. As such, there is a risk for allergic reaction when you come into contact with it and have an allergy to natural latex. Please ensure that you, the customer, are aware of this potential problem before making your purchase as we cannot accept any liability whatsoever for any problems caused by latex allergy.</p>\n</li>\n</ul><p dir=\"ltr\"> </p>\n<p dir=\"ltr\"><strong>Customers responsibility</strong></p>\n<ul><li dir=\"ltr\">\n<p dir=\"ltr\">All our supplied products are to be used in accordance with their intended purpose, and, when applicable, all included instructions for proper use must be observed in order to avoid any danger to life and limb. The product is used at the purchasers risk.</p>\n</li>\n</ul><p dir=\"ltr\"> </p>\n<p dir=\"ltr\"><strong>Feedback &amp; complaints</strong></p>\n<ul>