('4','3','About us','Learn more about us','about us, informations','<h1 class=\"page-heading bottom-indent\">About us</h1>\n<div class=\"row\">\n<div class=\"col-xs-12\">\n<div class=\"cms-block\">\n<p>When I first advertised a rubber rebreather bag on eBay in 2004 I was amazed how such a small tiny though tasty item attracted the attention of dozens. I could not imagine at that time that what started as fun was the starting point of an ever growing specialist rubber trading company: rubberfun.</p>\n<p>End of 2004 I started selling on eBay, first as a ‘ordinary’ client, but eventually as a business. Year after year with a steady growing list of customers, many of them coming back once they purchased one or more rubber items.</p>\n<p>Why rubber? Quite simple. I like this material with its incredible versatility, for the one being it a natural handy or plain useful item and for the other having a more ‘dark’ fetish attraction. After all it is our human mind and needs which defines the qualifications or special values of an object. Needless to say we like to cater for either interest. With a special place in my heart for the more adventurous side.</p>\n<p>Nowadays I sell much more rubber stuff both for at home and at the working place.</p>\n<p>Spring 2015 we had a 100% positive customer satisfaction on eBay with 7500+ completed sales transactions.</p>\n<p>Rubberfun has ever since it started has been committed to high quality rubber products for a small price.</p>\n<p>A special attention we have for the revival of rubber products from the fifties till seventies of the last century.</p>\n<p>Feel free to ask if you need something special or you can’t find it in our shop. We really like to help you.</p>\n<p>Ed &amp; Team</p>\n<p>19 March 2015</p>\n</div>\n</div>\n</div>','about-us'),
('4','4','About us','Learn more about us','about us, informations','<h1 class=\"page-heading bottom-indent\">About us</h1>\n<div class=\"row\">\n<div class=\"col-xs-12\">\n<div class=\"cms-block\">\n<p>When I first advertised a rubber rebreather bag on eBay in 2004 I was amazed how such a small tiny though tasty item attracted the attention of dozens. I could not imagine at that time that what started as fun was the starting point of an ever growing specialist rubber trading company: rubberfun.</p>\n<p>End of 2004 I started selling on eBay, first as a ‘ordinary’ client, but eventually as a business. Year after year with a steady growing list of customers, many of them coming back once they purchased one or more rubber items.</p>\n<p>Why rubber? Quite simple. I like this material with its incredible versatility, for the one being it a natural handy or plain useful item and for the other having a more ‘dark’ fetish attraction. After all it is our human mind and needs which defines the qualifications or special values of an object. Needless to say we like to cater for either interest. With a special place in my heart for the more adventurous side.</p>\n<p>Nowadays I sell much more rubber stuff both for at home and at the working place.</p>\n<p>Spring 2015 we had a 100% positive customer satisfaction on eBay with 7500+ completed sales transactions.</p>\n<p>Rubberfun has ever since it started has been committed to high quality rubber products for a small price.</p>\n<p>A special attention we have for the revival of rubber products from the fifties till seventies of the last century.</p>\n<p>Feel free to ask if you need something special or you can’t find it in our shop. We really like to help you.</p>\n<p>Ed &amp; Team</p>\n<p>19 March 2015</p>\n</div>\n</div>\n</div>','about-us'),
('5','1','Secure payment','Our secure payment mean','secure payment, ssl, visa, mastercard, paypal','<h2><strong>Our secure payment</strong></h2>\n<p>Pay easy and safe with our payments options: PayPal and Bank Wire.</p>\n<p> </p>\n<h4><strong>About PayPal</strong></h4>\n<p>PayPal allows you to pay easily and securely with your bank account or credit card without revealing your financial info to us.</p>\n<p>Your payment for purchases at Rubberfun is processed securely by PayPal. Here are some of the ways that PayPal keeps your information secure:</p>\n<ul><li>         PayPal means industry-leading security, encryption and fraud prevention tools.</li>\n<li>         PayPal does not share your financial information with us.</li>\n<li>         PayPal sends you a confirmation email when you make a payment.</li>\n<li>         PayPal offers buyer protection on eligible transactions for up to the full purchase price plus original shipping charges.</li>\n</ul><p> </p>\n<p><strong>Passing on of Customer Data</strong><br /> We use customer data exclusively for the processing of orders and do not pass any information on to third parties.</p>\n<p><strong> </strong></p>\n<p><strong>Security</strong><br /> Your data are transferred via an SSL connection. This security technology encrypts the information provided by you. Our Internet pages are located with one of the world’s largest web hosting providers.</p>','secure-payment'),
('5','2','Secure payment','Our secure payment mean','secure payment, ssl, visa, mastercard, paypal','<h2>Secure payment</h2>\n<h3>Our secure payment</h3>\n<p>With SSL</p>\n<h3>Using Visa/Mastercard/Paypal</h3>\n<p>About this services</p>','secure-payment'),
