('6','1','Privacy policy','Privacy policy',NULL,'<h1 dir=\"ltr\"><strong>Privacy policy</strong></h1>\n<p dir=\"ltr\">Version 1.0 – last update June-1-2015.</p>\n<p> </p>\n<p dir=\"ltr\">We are aware that you trust us. It is our responsibility to protect your privacy. On this page you can read which data we collect when you visit our website, why we collect these data and how we improve your experience using our website based on these data. So you will understand how we work.</p>\n<p dir=\"ltr\">This privacy policy applies to the services of . You must know that <a href=\"http://www.rubberfun.nl\">www.rubberfun.nl</a> is not responsible for the privacy policy of other websites and other sources. By using our website you acknowledge to accept our privacy policy.</p>\n<p dir=\"ltr\"><a href=\"http://www.rubberfun.nl\">www.rubberfun.nl</a> respects the privacy of all the visitors/users of its website and ensures that all personal information which you will give us, will be dealt with in a strict confidential manner.</p>\n<p> </p>\n<h3 dir=\"ltr\"><strong>How we use the collected data</strong></h3>\n<p dir=\"ltr\"><strong>Our Services</strong></p>\n<p dir=\"ltr\">When you order one of our services/products then we will ask for personal data like name, birthdate etc. These data will be used to execute your order. These data will be stored on a security server owned by <a href=\"http://www.rubberfun.nl\">www.rubberfun.nl</a> or by a third party. We will not combine your personal data with other data.</p>\n<p dir=\"ltr\"><strong>Communication</strong></p>\n<p dir=\"ltr\">When you send emails or other messages to us it will be possible that we will save these messages. Sometimes we will ask for your personal data when this is relevant. This enables us to answer your questions and requests. These data will be stored on a security server owned by <a href=\"http://www.rubberfun.nl\">www.rubberfun.nl</a> or by a third party. We will not combine your personal data with other data.</p>\n<p dir=\"ltr\"><strong>Cookies</strong></p>\n<p dir=\"ltr\">We collect data for research to get a better insight in our clients in order to tailor our services/products.</p>\n<p dir=\"ltr\">This websites uses cookies. A cookie is a small piece of data sent from a website and stored in a user’s web browser while the user is browsing the website. Every time the user loads the website, the browser sends the cookie back to the server to notify the website of the user’s previous activity. This information gathered by the cookie will be stored on the security server of <a href=\"http://www.rubberfun.nl\">www.rubberfun.nl</a> or by a third party. We use this information to see how you use the website and to make reports on website activity in order to offer you other services and products related to your activity on internet.</p>\n<p dir=\"ltr\"><strong>Purpose</strong></p>\n<p dir=\"ltr\">We collect and use this information for no other purposes than described in our private policy unless we have received your permission to do otherwise.</p>\n<p dir=\"ltr\"><strong>Third Parties</strong></p>\n<p dir=\"ltr\">We will not provide your data to other parties. In some cases your data will be shared internally but our personnel signed a non disclosure contract to respect the confidentiality of your personal data.</p>\n<p dir=\"ltr\"><strong>Alterations</strong></p>\n<p dir=\"ltr\">This privacy policy is tuned to the current status of our website. Adjustments or changes on our website can lead to changes in the privacy policy. So we advise you to read our privacy policy on a regular basis.</p>\n<p dir=\"ltr\"><strong>Personal Data Options</strong></p>\n<p dir=\"ltr\">We offer all visitors the possibility to look at, to change or to delete all personal data which has been provided to us.</p>\n<p dir=\"ltr\"><strong>Adjustments and termination/removal of Newsletter</strong></p>\n<p dir=\"ltr\">At the bottom of all our mails you will find the possibility to adjust your personal data or to terminate the newsletter.</p>\n<p dir=\"ltr\"><strong>Adjustments/Removal communication</strong></p>\n<p dir=\"ltr\">If you would like to alter your personal data or to remove these from our files then you can contact us. See below for contact information.</p>\n<p dir=\"ltr\"><strong>Switch off cookies</strong></p>\n<p dir=\"ltr\">Most browsers are set up to accept cookies but you can set up your browser to refuse cookies or to notify you when a cookie is being sent to you. It is however possible that some services and functions on our website and on other website do not function properly when you have switched off cookies on your browser.</p>\n<p dir=\"ltr\"><strong>Questions and Feedback</strong></p>\n<p dir=\"ltr\">We check on a regular basis if we comply with the privacy policy. If you have questions about our privacy policy do contact us:</p>\n<p> </p>\n<p dir=\"ltr\">LRG Utrecht</p>\n<p dir=\"ltr\">Ed Groenendijk</p>\n<p dir=\"ltr\">Händelstraat 82</p>\n<p dir=\"ltr\">3533 GM Utrecht <br class=\"kix-line-break\" /><br class=\"kix-line-break\" /></p>\n<p><span id=\"docs-internal-guid-8e64d419-b63e-77a5-7746-2f2f484102d1\">Phone number: +31 6 20168707, Monday to Friday 9 AM – 18PM. <br class=\"kix-line-break\" />E-mail: info@rubberfun.nl<br class=\"kix-line-break\" />Chamber of commerce number: 30274259<br class=\"kix-line-break\" />VAT identification number: NL091943504B01</span></p>','privacy-policy'),
