('7','3','Shipments & Returns','Shipments & Returns',NULL,'<h2 dir=\"ltr\"><strong>Shipments &amp; Returns</strong></h2>\n<p dir=\"ltr\"> </p>\n<h4 dir=\"ltr\">Shipments</h4>\n<p dir=\"ltr\">Packages are generally dispatched within 3 days after receipt of payment and are shipped via Post NL, DHL Global mail or GLS.</p>\n<p dir=\"ltr\">Generally goods with value lower than EUR 20.00 are shipped without tracking and drop-off signature. If you prefer registered delivery and/or tracking an additional cost will be applied, so please contact us before choosing this method.</p>\n<p dir=\"ltr\">Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment and destination.</p>\n<p dir=\"ltr\">We advise you to group your items in one order. If you place 1+ distinct orders separately, please send us an email and ask for a Grand Total; whenever possible we will give you a combined discount on postage.</p>\n<p dir=\"ltr\">Your package will be dispatched at your own risk, but special care is taken to protect fragile objects. Boxes are amply sized and your items are well-protected. To ensure privacy all goods are neutrally packed.</p>\n<p dir=\"ltr\">Depending on the shipment choice you make, we will provide you with a link to track your package online.</p>\n<p> </p>\n<h4 dir=\"ltr\"><strong>Returns</strong></h4>\n<p dir=\"ltr\">Hygiene items do not qualify for returns, except if the item is faulty.</p>\n<p dir=\"ltr\">For serious quality defects of our product, we will refund fully.</p>\n<p dir=\"ltr\">You must inform us immediately about any faulty item and it must be returned within 48h after the delivery. Return postage to be paid by the buyer.</p>\n<p> </p>\n<p dir=\"ltr\">&gt;&lt;</p>\n<p> </p>\n<p> </p>','shipments-returns'),
('7','4','Shipments & Returns','Shipments & Returns',NULL,'<h2 dir=\"ltr\"><strong>Shipments &amp; Returns</strong></h2>\n<p dir=\"ltr\"> </p>\n<h4 dir=\"ltr\">Shipments</h4>\n<p dir=\"ltr\">Packages are generally dispatched within 3 days after receipt of payment and are shipped via Post NL, DHL Global mail or GLS.</p>\n<p dir=\"ltr\">Generally goods with value lower than EUR 20.00 are shipped without tracking and drop-off signature. If you prefer registered delivery and/or tracking an additional cost will be applied, so please contact us before choosing this method.</p>\n<p dir=\"ltr\">Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment and destination.</p>\n<p dir=\"ltr\">We advise you to group your items in one order. If you place 1+ distinct orders separately, please send us an email and ask for a Grand Total; whenever possible we will give you a combined discount on postage.</p>\n<p dir=\"ltr\">Your package will be dispatched at your own risk, but special care is taken to protect fragile objects. Boxes are amply sized and your items are well-protected. To ensure privacy all goods are neutrally packed.</p>\n<p dir=\"ltr\">Depending on the shipment choice you make, we will provide you with a link to track your package online.</p>\n<p> </p>\n<h4 dir=\"ltr\"><strong>Returns</strong></h4>\n<p dir=\"ltr\">Hygiene items do not qualify for returns, except if the item is faulty.</p>\n<p dir=\"ltr\">For serious quality defects of our product, we will refund fully.</p>\n<p dir=\"ltr\">You must inform us immediately about any faulty item and it must be returned within 48h after the delivery. Return postage to be paid by the buyer.</p>\n<p> </p>\n<p dir=\"ltr\">&gt;&lt;</p>\n<p> </p>\n<p> </p>','shipments-returns'),
