('1','1','0','Gfeygddgh',NULL,'1398113737','Mozilla/5.0 (Linux; Android 4.4.2; GT-I9515 Build/KOT49H) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/42.0.2311.61 Mobile Safa','2015-04-02 23:51:41','2015-04-02 23:51:41','0','0'),
('2','1','1','Dear Customer,\r\n\r\nThank you for your message. We have all the items you need.\r\n\r\nPlease send your list and I will give you a quote with best postage possible.\r\n\r\nRegards,\r\nCustomer service',NULL,'1398113737',NULL,'2015-04-03 09:20:15','2015-04-03 09:20:15','0','1'),
('3','1','1','Dear Customer,\r\n\r\nRegards,\r\nCustomer service',NULL,'1398113737',NULL,'2015-05-06 21:57:59','2015-05-06 21:57:59','0','1'),
('5','3','0','I do have some questions about the sheeting size. In which with sizes are they available. It dies not show in your pages.\r\n',NULL,'1372330187','Mozilla/5.0 (Linux; Android 4.2.2; GT-P5110 Build/JDQ39) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.76 Safari/537.3','2015-10-31 06:46:31','2015-10-31 06:46:31','0','0'),
('6','1','0','Tekst formulier slecht leesbaar',NULL,'-1861225356','Mozilla/5.0 (Linux; Android 5.0.1; GT-I9515 Build/LRX22C) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/46.0.2490.76 Mobile Safa','2015-10-31 11:25:01','2015-10-31 11:25:01','0','0'),
('7','4','0','Hey,\r\n\r\nIk kwam jullie toevallig tegen via de duitse ebay, fantastisch assortiment hebben jullie! Mijn fetish is bondage en inhalatieanesthesie met vooral zwarte rubberen maskers etc. Het pronkstuk van mijn collectie is een in bijna nieuwstaat verkerende en werkende  Dräger Agrippa uit 1952 voor lachgas/ether narcoses. \r\n\r\nIk sta er echt van te kijken dat er zoveel gelijkgestemde mensen zijn na het lezen van jullie verhaal over het succes van Rubberfun. Zijn er misschien ook communities in Nederland waar jullie van weten? Of leuke vrouwen die eenzelfde fetish hebben en eens hun droom waar willen maken? \r\n\r\nmvg,\r\n\r\nmr.hawaii','5639063c9738f.jpeg','1303050667','Mozilla/5.0 (Windows NT 6.1; Trident/7.0; rv:11.0) like Gecko','2015-11-03 20:08:45','2015-11-03 20:08:45','0','0'),
('8','5','0','Hallo Ed,\r\nich würde mich sehr freuen, wenn Sie mir mitteilen könnten, was der von mir beschriebene Spannbettbezug aus weißen Mackintosh-Gummi kosten würde.\r\nHerzliche Grüße Wolfgang',NULL,'-735763155','Mozilla/5.0 (iPad; CPU OS 9_1 like Mac OS X) AppleWebKit/601.1.46 (KHTML, like Gecko) Version/9.0 Mobile/13B143 Safari/601.1','2015-11-08 10:21:39','2015-11-08 10:21:39','0','0'),
('9','5','1','Hallo Wolfgang,\r\n\r\nMein webshop reagiert noch nicht ganz richtig (und ich muss mich daran gewöhnen sehr regelmässig im Back Office rund zu schauen ob es Nachrichten und Verkäufe gibt).  Und am Wochenende war ich beschäftigt mit eine Fetisch Börse (Kinky Warehouse Sale in Spijkenisse, nähe Rotterdam). Also eine Verspätung in miener Antwort. Meine Entschüldigung dafür.\r\n\r\nEin Spannbettzug im grösse 150x250 cm und eine höhe von 15 cm soll EUR 179,95 kosten. Gummituch ist 0.45 mm (Q1)\r\n\r\nEin Spannbettzug im grösse 150x250 cm und eine höhe von 20 cm soll EUR 189,95 kosten. Gummituch ist 0.45 mm (Q1)\r\n\r\nHerzliche Grüsse,\r\n\r\nEd.\r\n\r\nKind regards,\r\n\r\nEd\r\nwebshop rubberfun.nl',NULL,'1398113737',NULL,'2015-11-09 14:28:38','2015-11-09 14:28:38','0','1'),
('10','5','0','Hallo Ed,\r\nmein Spannbettbezug hat die Größe von 100x200 cm, allerdings eine Höhe von 26 cm.  Bitte sagen Sie mir den Preis.\r\nDanke und herzliche Grüße Wolfgang',NULL,'-735763155','Mozilla/5.0 (iPad; CPU OS 9_1 like Mac OS X) AppleWebKit/601.1.46 (KHTML, like Gecko) Version/9.0 Mobile/13B143 Safari/601.1','2015-11-09 15:02:10','2015-11-09 15:02:10','0','0'),
('11','5','1','Hallo Wolfgang,\r\n\r\nGröße 100x200 cm und Höhe 26 cm macht es etwas billiger.\r\n\r\n0.42 mm dicke (38W1A Tuch): EUR 149.95 + Versand (DHL mit tracking, EUR 12,50) = EUR 162,95.\r\n0.45 mm dicke (38W1B Tuch): EUR 159.95 + Versand (DHL mit tracking, EUR 12,50) = EUR 172,95.\r\n\r\nUnd wir haben auch noch dabei Ua passende Kopfkissen.\r\n\r\nBezahlung bitte mit online Banking. Wir brauchen 1-2 Wohcen für die Fertigung.\r\n\r\nKind regards,\r\n\r\nEd\r\nwebshop rubberfun.nl',NULL,'1398113737',NULL,'2015-11-09 18:21:42','2015-11-09 18:21:42','0','1'),
('12','6','0','Hello, thank you for your order. We have started very recently our webshop and face some difficulties with the PayPal checkout (plus a few other inconveniences).  Please send your payment directly to our PayPal account \"lrgutrecht@gmail.com\". PayPal guarantees you get your money back if something might go wrong. One other option is our still functional ebay webstore (hppt://stores.ebay.co.uk/rubberfun).\n\nBest regards,\n\nEd.',NULL,NULL,NULL,'2015-11-09 23:30:53','2015-11-09 23:30:53','0','0'),
('13','7','1','Hello, thank you for your order. We have started very recently our webshop and face some difficulties with the PayPal checkout (plus a few other inconveniences). Please send your payment directly to our PayPal account \"lrgutrecht@gmail.com\". PayPal guarantees you get your money back if something might go wrong. One other option is our still functional ebay webstore (hppt://stores.ebay.co.uk/rubberfun). Best regards, Ed.',NULL,NULL,NULL,'2015-11-09 23:38:47','2015-11-09 23:38:47','1','0'),
('14','5','0','Hallo Ed, ich würde dann das Mackintoshgummi in weiß mit 45 mm Dicke nehmen. \r\nKann ich denn auch mit PayPal bezahlen? Wenn nein. Dann geht die Bestellung etwas später, denn ich bin noch bis Samstag in einer Woche nicht zu Hause und kann deshalb keine Überweisung veranlassen. \r\nHerzliche  Grüße  Wolfgang',NULL,'-735763155','Mozilla/5.0 (iPad; CPU OS 9_1 like Mac OS X) AppleWebKit/601.1.46 (KHTML, like Gecko) Version/9.0 Mobile/13B143 Safari/601.1','2015-11-11 15:49:25','2015-11-11 15:49:25','0','0');
