('69','1','1','<p>Art.no. 34</p>\n<p> </p>\n<p>Head straps for medical face piece or anesthesia mask. Or any other mask with metal S-ring. Synthetic rubber (latex free). Non sterile. Anti static. For easy fixating.</p>\n<p>Provides easy and good support of face mask. Fully adjustable which helps to ensure tight and perfect fit on patient\'s face. Reinforced holes ensure a long, durable life.</p>\n<p>The big flat part of the harness goes behind the head, and the straps stretch around the head to hold the mask in front of the face in place. The reinforced holes fit into the metal hooks of the mask.</p>\n<p><strong>Available sizes</strong>: one size fits all.</p>','<p>Head binding straps for anesthesia mask. Non sterile. Anti static.</p>','mask-binding-straps',NULL,NULL,NULL,'Mask binding straps',NULL,NULL),
