('176','1','1','<p>Art.no. 12RCB1</p>\n<p> </p>\n<p>Cock &amp; Ball cage. Two connected heavy duty rubber rings. Red rubber. 10 mm thick. Sizes: XS-XL. No stretch, just firm, flexible rubber. Simple erection aid or stimulator.</p>\n<p> </p>\n<p>For those who like rubber or want to try for a first time before buying expensive ones.</p>\n<p> </p>\n<p>Set of one smaller (shaft) and one larger (balls) or inverse.</p>\n<p> </p>\n<p>You can choose from 4 sets and 5 sizes. Set 3 is the default set; if you don\'t choose you will get this one (it suits average male). Not the sizes you are looking for? We make one based on availabe ring sizes.</p>\n<p> </p>\n<p><span style=\"text-decoration:underline;\">Sets:</span></p>\n<p>Set 1: combination of XS-S. Each size 1x. (xsmall / art.no. 12RCB1A)</p>\n<p>Set 2: combination of S-M. Each size 1x. (small / art.no. 12RCB1B)</p>\n<p>Set 3: combination of M-L. Each size 1x. (standard / art.no. 12RCB1C)</p>\n<p>Set 4: combination of L-XL. Each size 1x. (xlarge / art.no. 12RCB1D)</p>\n<p> </p>\n<p> </p>\n<p><strong>Sizes</strong>: extra small - small - medium (= standard) - large and extra large.</p>\n<p><strong>Dimensions</strong>: 27x50 mm (extra small), 33x56 mm (small), 40x62 mm (standard/medium), 52x75 mm (large) and 58x81 mm (xlarge)</p>\n<p>Price is for set of 3 rings. Set A (12RS3A): XS-M, set B (12RS3B): S-L, set C (12RS3C): M-XL.</p>','<p>Cock &amp; Ball cage. Two connected heavy duty rubber rings. Red rubber. 10 mm thick. Sizes: XS-XL</p>','cock-ball-cage','Red rubber ring - Pessarie / cock ring - size S to XL',NULL,'Red rubber ring - pessarie - cock ring','Cock & Ball cage - duo',NULL,NULL),
